import PhoneDrop from "./phoneDrop";
import SocDrop from "./socDrop";

function DropDown({turn, hidePhhideSoc, socSpace, atDrop}){


    const turnDisplay = () => {
        if(turn === "Phone"){
            return (<PhoneDrop />);
        }else if(turn === "Soc"){
            return (<SocDrop hideSoc={hideSoc} socSpace={socSpace} atDrop={atDrop} />);
        } 
    }

    return(
        <div id={`dropDown${turn}`}> 
            {turnDisplay()}      
        </div>
    )

//end of component
};

export default DropDown;
